import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="navBar">
        <button>Home</button> | <button>Movies</button> |{" "}
        <button>Log In</button> | <button>Register</button> |{" "}
        <button>FAQ</button>
      </header>
      <p className="subTitle">Movie App</p>
      <p className="message">Welcome!</p>
      <p>
        <i>Created by</i> <strong>Vail Arvia</strong>
      </p>
      <div>
        <h2>LogIn</h2>
        <form>
          <input type="text">{/* <label for="name"></label> */}</input> <br />
          Password:<input label for="Password" type="password"></input>
        </form>
      </div>
      <div>// Registration form</div>
    </div>
  );
}

export default App;
